import { Component } from "@angular/core";

@Component({
    selector:'app-one',
    templateUrl:'./one.component.html'
})

export class OneComponent{
    allowServer:boolean = true;
    constructor(){
        setTimeout(() => {
            this.allowServer = false;
        }, 1000);
    }
    
}
